import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import MyNarbar from './myNavbar';
import Image from 'react-bootstrap/Image'

const Home = () => {
  return (
    <>
      <MyNarbar />
      <p style={{color: "white", fontSize: "3em", position: "relative", top: "2em", left: "2em", zIndex: "2"}}>Welcome to my page!</p>
      <Image
        src="explorer.png"
        width="100%"
      />
    </>
  );
}

export default Home;
